import React, { useContext } from 'react'
import '../css/TodoCounter.css';

function TodoCounter() {
  const {total, completed} = useContext()

  return (
    <h2 className='TodoCounter'>{`Has completado ${completed} de ${total} TODOs`}</h2>
  )
}

export { TodoCounter }
